        setcounter(count+1)

    }
    const RESET =()=>{
        setcounter(RESET.slice(0,-1))
    }
  return (

    <div>
<h1>Count {count}</h1>
      <button onClick={COUNTS}> click</button>
      <button onClick={RESET}>RSEST</button>
    </div>
  )
}

export default Usestate
